import React from 'react';
import {StyledHeader, StyledSpan, StyledLogo} from "./AppHeader.styled";

const AppHeader = ({data}) => {
    console.log(data);
    const doneCount = data.filter((item) => item.done).length;
    console.log(doneCount);
    return (
        <StyledHeader>
            <StyledLogo>Todo List</StyledLogo>
            <StyledSpan>4 more todo, 1 done</StyledSpan>
        </StyledHeader>
    )
};

export default AppHeader;
